  b 28.06.1939
  Patricia, d/o Walter Stanley Lee and Eileen Mary Stent, b. at Perth, Western Australia. Address: 2/17
  Lorikeet Court, Stirling 6021, Western Australia.
  Richard was educated at St George's Preparatory School, Wanganui, and Wanganui Collegiate School. He
  was a Royal Navy Special Entrance Cadet in 1942 and was posted as a Midshipman to HMS Rodney. He saw
  the invasion of Sicily, Salerno and D-Day of the Normandy beaches. He served on HMS Nubian and HMS/M
  Virulent and was a Sub-Lieutenant aboard HM Submarine Sportsman. After the war he was with the 4th
  Submarine Flotilla in HMS Adamant and HMS/Ms Amphion and Affray, based in Hong Kong. He resigned his
  commission as a Lieutenant in 1949.
  Richard then worked for Hawker Aircraft at Kingston-on-Thames, England, in the Planning and Buying
